de, connecting UI to our back end and third-party system.</li>\r\n<li>&nbsp;&nbsp;&nbsp; Analyze software requirements and provide solutions. Perform analysis, design, coding, testing, implementation, and maintenance of Web application solutions.</li>\r\n<li>&nbsp;&nbsp;&nbsp; Must have a solid grasp of object-oriented programming, automated software testing, databases, development, and testing methodologies.</li>\r\n<li>&nbsp;&nbsp;&nbsp; Take smart risks and champion new ideas. Be comfortable with iterative and incremental development. Be willing to help your teammates, share your knowledge with them, and learn from them. Be open to receiving feedback.</li>\r\n</ul>\r\n<p><br /><strong>* Please apply only if you have at least 2 years of a working experience in Ruby on Rails in a reputable company. Thank You.</strong></p>	LHR, PK	2017-01-31	2017-07-01	\N	2	2	2017-01-31 12:46:01.296552	2017-01-31 12:46:01.296552	t	Web Development	f	\N	\N	\N	\N	\N	\N	\N	\N	\N	Job
